                  Warning
                </Badge>{' '}
                <Badge pill variant="info">
                  Info
                </Badge>{' '}
                <Badge pill variant="light">
                  Light
                </Badge>{' '}
                <Badge pill variant="dark">
                  Dark
                </Badge>
              <Col >





              </Col> 
              <Col xs={{ order: 'last' }}>

              </Col>             
            </Row>


          </Container>

        </section>      

    </div>

  );
}
export default About;
